import React, { Component } from "react";
import { CssBaseline, Typography,Container } from '@material-ui/core';
import Button from '@mui/material/Button';
import SendIcon from '@mui/icons-material/Send';
import Intro from './Intro'
import Result from './Result'
import Userinfo from './Userinfo'



class App extends Component {
    constructor(props) {
        super(props)
        this.state = {
          showInfo: 0
        }
        this._onStartClick = this._onStartClick.bind(this)

      }

    renderIntro() {
        return <Intro _onStartClick={this._onStartClick} title="" />
        // 여기가 타이틀
      }
      
    renderUserinfo() {
        return <Userinfo />
    }
    renderResult() {
      return <Result  />
  }

   
    render() {
        let showInfo = this.state.showInfo 
        //this.state 를 사용함으로써 위에 props에 있는 state, 즉 여기서는 showquestion의 상태를 불러옴
        (showInfo === true ?  this.renderIntro() : this.renderUserinfo())
      }

    _onStartClick() {
       this.setState({ showInfo: !this.state.showInfo})
      }

     
}

export default App
